//SPDX-License-Identifier: MIT
pragma solidity ^0.8.3;

import "@openzeppelin/contracts/token/ERC721/ERC721.sol";
import "./owner/AdminRole.sol";
import "./NFTBonus.sol";


interface INFTToMiningPool {
    function updateStakeToken(address _owner, uint256 _extraAddR) external;
}

contract VipNFT is ERC721, AdminRole {

    mapping(uint256 => CardItem) public nftsDict;
    mapping(uint32 => uint256) public nftsLevelNum;    // 各等级有多少NFT
    mapping(uint32 => LvConf) public vipLvConf;   // vip等级配置数据
    mapping(address => uint8) public whiteList;    // 可以拥有超过一个NFT的地址
    mapping(address => uint256) ownerVipNFT;

    uint256 nftNumber = 10000;     // 0为无效NFT
    INFTToMiningPool miningPool;

    struct CardItem {
        uint8 exists;       // 1存在、0不存在
        uint32 level;       // 等级
    }

    struct LvConf {
        uint8 exists;           // 1存在、0不存在
        uint256 extraAddR;      // 加成算力比例
        uint256 rewdBuyR;       // 购卡奖励比例
        uint256 hToken;          // 持有
//        uint256 bonusR;         // 分红比例
//        uint32[] condLvList;    // 升级条件中有数量限制的等级
//        mapping(uint32 => uint256) condNumList;     // 升级条件中等级限制数量
    }

    constructor() ERC721("Joinswap CARD", "JCARD") {
    }

    modifier checkOwner(address _owner, uint256 _nftNumber) {
        require(ownerOf(_nftNumber) == _owner, "NFTCardStore: it's Not of you !");
        _;
    }

    function transferFrom(address from, address to, uint256 tokenId)
        public virtual override
    {
        if (whiteList[to] == 0) {
            require (balanceOf(to) == 0, "VipNFT: too many");
        }
        super.transferFrom(from, to, tokenId);
        miningPool.updateStakeToken(from, 0);
        miningPool.updateStakeToken(to, vipLvConf[nftsDict[tokenId].level].extraAddR);

        ownerVipNFT[from] = 0;
        ownerVipNFT[to] = tokenId;
    }

    function safeTransferFrom(address from, address to, uint256 tokenId)
        public virtual override
    {
        if (whiteList[to] == 0) {
            require (balanceOf(to) == 0, "VipNFT: too many");
        }
        super.safeTransferFrom(from, to, tokenId);
        miningPool.updateStakeToken(from, 0);
        miningPool.updateStakeToken(to, vipLvConf[nftsDict[tokenId].level].extraAddR);
        ownerVipNFT[from] = 0;
        ownerVipNFT[to] = tokenId;
    }

    function _safeMint(address to, uint256 tokenId)
        internal virtual override
    {
        if (whiteList[to] == 0) {
            require (balanceOf(to) == 0, "VipNFT: too many");
        }
        super._safeMint(to, tokenId);
        miningPool.updateStakeToken(to, vipLvConf[nftsDict[tokenId].level].extraAddR);
    }

    function isExists(uint256 _nftNo)
        public view
        returns (uint8)
    {
        return nftsDict[_nftNo].exists;
    }

    function getOwnerNFTInfo(address _owner)
        public view
        returns (uint256 nftNo, uint32 level)
    {
        nftNo = ownerVipNFT[_owner];
        if (nftNo > 0){
            level = nftsDict[nftNo].level;
        } else {
            level = 0;
        }
    }

    function getOwnerNFTNo(address _owner)
        public view
        returns (uint256)
    {
        return ownerVipNFT[_owner];
    }

    function getNFTsLevelNum(uint32 _level)
        public view
        returns (uint256 lvNum)
    {
        lvNum = nftsLevelNum[_level];
    }

    function getNFTLevel(uint256 _nftNo)
        public view
        returns (uint32)
    {
        require (nftsDict[_nftNo].exists > 0, "VipNFT: no exists");
        return nftsDict[_nftNo].level;
    }

    // 获取加成算力
    function getNFTExtraAddRate(uint256 _nftNo)
        public view
        returns (uint256 extraAddR)
    {
        extraAddR = 0;
        if (_nftNo > 0 && nftsDict[_nftNo].exists > 0) {
            extraAddR = vipLvConf[nftsDict[_nftNo].level].extraAddR;
        }
    }

    function createNFT(address _to, uint32 _level)
        public onlyAdmin
        returns (uint256 nftNo)
    {
        // 获取NFT的序号
        nftNumber++;

        nftNo = nftNumber;
        // 创建carditem
        nftsDict[nftNo] = CardItem(1, _level);
        _safeMint(_to, nftNo);
        ownerVipNFT[_to] = nftNo;

        nftsLevelNum[_level] += 1;
    }

    // NFT升级
    function levelupNFT(uint256 _nftNo, uint32 _newLevel)
        public onlyAdmin
    {
        // 等级对不对
        require (nftsDict[_nftNo].level + 1 == _newLevel, "VipNFT, level error");
        nftsDict[_nftNo].level = _newLevel;
        nftsLevelNum[_newLevel] += 1;
        nftsLevelNum[_newLevel - 1] -= 1;
        address nftOwner = ownerOf(_nftNo);
        miningPool.updateStakeToken(nftOwner, vipLvConf[_newLevel].extraAddR);
    }

    // Admin
    function addNFTLvConf(
        uint32[] memory _levelList,
        uint256[] memory _extraAddRList,
        uint256[] memory _rewdBuyRList,
        uint256[] memory _hTokenList
    ) public onlyAdmin {
        for (uint256 index = 0; index < _levelList.length; index++) {
            vipLvConf[_levelList[index]] =
                LvConf(
                    1,
                    _extraAddRList[index],
                    _rewdBuyRList[index],
                    _hTokenList[index]
                );
        }
    }

    function removeNFTLvConf(uint32 _level)
        public onlyAdmin
    {
        delete vipLvConf[_level];
    }

    function setWhiteList(address _addr, uint8 _open)
        public onlyAdmin
    {
        // _open > 0 为开，0为关。
        whiteList[_addr] = _open;
    }

    function setMiningPool(INFTToMiningPool _pool)
        public onlyAdmin
    {
        miningPool = _pool;
    }

}
